description:
Designed in China

Technology Documentary hosted by Carrie Gracie, published by BBC broadcasted as part of BBC Our World series in 2014 - English narration


Information
------------------------------

&quot;Assembled in China&quot; but designed in California, Japan or Europe: that's been the story of China for the past 30 years. But now China is pouring billions into innovation in a bid to produce the next breakthrough products and ideas. For Our World, the BBC's China Editor, Carrie Gracie, explores whether China's great push to innovate is succeeding, or whether cultural factors hold China back from becoming a truly innovative power. She meets the startup innovators building their own 3D printers and robots and she visits a state-funded telescope whose cutting edge China-designed technology, enables it to see more of the sky than any other.

